import React from "react";
import { useSelector } from "react-redux";

export const List = () => {
  const todos = useSelector((state) => {
    return state.todos;
  });
  return (
    <div>
      {todos.map((todo) => {
        return (
          <div key={todo.id}>
            {todo.id}
            {todo.title}
            {todo.body}
            {todo.isDone.toString()}
          </div>
        );
      })}
    </div>
  );
};

export default List;
